import React, { useContext } from 'react';
import { ProjectContext } from '../contexts/ProjectContext';
import EditableField from './EditableField';

const ProjectOverviewPanel = () => {
    const { projectName, projectTitle, projectDescription } = useContext(ProjectContext);

    return (
        <div className="p-4 border rounded-lg shadow-md bg-white">
            <h1 className="text-xl font-bold">{projectName}</h1>
            <h2 className="text-lg text-gray-700">{projectTitle}</h2>
            <EditableField 
                label="Project Description" 
                initialValue={projectDescription} 
            />
        </div>
    );
};

export default ProjectOverviewPanel;
